import React from "react";
import menucocina from "../img/01-menu-cocina.svg";
import { Link } from "react-router-dom";
import Chef from "./Chef";

const Boton = function (props) {
  return <button onClick={() => this.onclick()}>Soy un boton</button>;
};

export default Boton;

/*<Link to="/chef">
<img src={menucocina} className="Fitness-Add" alt="exercise" />
</Link>
*/
const onclick = function () {
  <Link to="/chef">
    <img src={menucocina} className="Fitness-Add" alt="exercise" />
  </Link>;
};
